BASE_URL = 'https://frontend-test-api.aircall.io';

const authenticate = () => {
  const configurationObject = {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      Accept: 'application/json'
    },
    body: JSON.stringify({
      username: 'Dinno',
      password: 'crebdrug'
    })
  };

  return fetch(BASE_URL + 'auth/login');
};
